GCInitialStep.actionText:
S WHITE = RGBToInt(1,1,1);
S YELLOW = RGBToInt(1,1,0);
S BLACK = RGBToInt(0,0,0);
S RED = RGBToInt(1,0,0);
S Seq20.setVisible(0); // Dummy for MacroStep P action

P BeadSorter.Bead = BeadSorter.ResetBead ? 0 : BeadSorter.Bead;
P BeadSorter.Color = BeadSorter.ResetColor ? 0 : BeadSorter.Color;
P Sol1.setLocation(BeadSorter.Sol1 ? Sol1Open : Sol1Closed, Sol1.getYLocation());
P Sol2.setLocation(BeadSorter.Sol2 ? Sol2Open : Sol2Closed, Sol2.getYLocation());
P Sol3.setLocation(BeadSorter.Sol3 ? Sol3Open : Sol3Closed, Sol3.getYLocation());
P Sol4.setLocation(BeadSorter.Sol4 ? Sol4Open : Sol4Closed, Sol4.getYLocation());
P LED.setFillColor(BeadSorter.LED ? RED : BLACK);
P Down.setVisible(!BeadSorter.Tilt);
P Up.setVisible(BeadSorter.Tilt);

X Down.setVisible(0);
X Up.setVisible(0);
X CBOverfull.setVisible(0);
X CYOverfull.setVisible(0);

GCStep.actionText:
S BRef = "CB" + nextCB;
S BCol = BRef^.getFillColor() == YELLOW;
S BRef^.setFillColor(WHITE);
S nextCB = nextCB + 1;
S SeqBead.spawn("V Color = BCol;");

S YRef = "CY" + nextCY;
S YCol = YRef^.getFillColor() == YELLOW;
S YRef^.setFillColor(WHITE);
S nextCY = nextCY + 1;
S SeqBead.spawn("V Color = YCol;");

S BeadSorter.Bead = 1;
S SeqRef = "Seq" + nextSeq;
S SeqRef^.setFillColor(Color ? YELLOW : BLACK);
S nextSeq = nextSeq - 1;

MacroStep.actionText:
P temp = nextSeq + 1;
P ColRef = "Seq" + temp;
P BeadSorter.Color = BeadSorter.Color | ColRef^.getFillColor() == YELLOW;

GCStep.actionText:
S temp = nextSeq + 1;
S SeqRef = "Seq" + temp;
S Color = SeqRef^.getFillColor() == YELLOW;

S SeqRef^.setFillColor(WHITE);
S nextSeq = nextSeq + 1;
S SortBead.spawn("V Color = Color;");

S temp = nextCB - 1;
S Ref = "CB" + temp;
S Ref^.setFillColor(Color ? YELLOW : BLACK);
S nextCB = nextCB - 1;

S temp = nextCY - 1;
S Ref = "CY" + temp;
S Ref^.setFillColor(Color ? YELLOW : BLACK);
S nextCY = nextCY - 1;

